import {useNavigate} from 'react-router-dom';
import ArtistsPage from './ArtistsPage'

const ArtistsHome = () => {
    let navigate = useNavigate();
    function search(formData :any) {
        const query = formData.get("artist");
        navigate(`/artistsSearch/${query}`)
      }
    return (
      <>
      <div className='w-fit flex flex-col pb-[10em]'>
        <h2 className="text-white">Rechercher un artiste</h2>
            <form action={search}>
                <input type="text" name='artist' placeholder="Nom d'artiste"/>
                <input type="submit" value="Rechercher"/> 
            </form>
            <ArtistsPage />
      </div>
      </>
    );
  };

  export default ArtistsHome;
